/* eslint-disable */
/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmDash,
  VmFile,
  VmVideo 
} from '@vime/core';

import { define } from '../lib';


define('vm-dash', VmDash);
define('vm-file', VmFile);
define('vm-video', VmVideo);


export interface DashProps extends JSX.VmDash, HTMLAttributes<HTMLVmDashElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmDashElement, DashProps>(
  'vm-dash',
  new Set(['src','version','libSrc','config','autoplay','crossOrigin','preload','poster','controlsList','autoPiP','disablePiP','disableRemotePlayback','mediaTitle','enableTextTracksByDefault','shouldRenderNativeTextTracks','isTextTrackVisible','currentTextTrack']),
);
